/**
 * 根据省份名查找省份数据
 */
export function findProvinceByName(name: string): ProvinceData | undefined {
    return provinces.find(p => p.name === name)
}

/**
 * 获取所有省份名称列表
 */
export function getAllProvinceNames(): string[] {
    return provinces.map(p => p.name)
}
